public class Solution {
    public int NumberOfBeautifulIntegers(int low, int high, int k) {
        int count = 0;
        for (int num = (low + k - 1) / k * k; num <= high; num += k) { // Start from the first multiple of k greater than or equal to low
            if (IsBeautiful(num)) {
                count++;
            }
        }
        return count;
    }

    private bool IsBeautiful(int number) {
        int evenDigits = 0, oddDigits = 0;
        while (number > 0) {
            int digit = number % 10;
            if (digit % 2 == 0) evenDigits++;
            else oddDigits++;
            number /= 10;
        }
        return evenDigits == oddDigits;
    }
}
